const Button = ({ 
    type = "primary", 
    size = "md", 
    text="Submit", 
    handleClick 
}) => {
  return (
    <button 
        onClick={handleClick}
        className={`btn btn-${type} btn-${size} p-2`}
    >
        {text}
    </button>
  )
}

export default Button;
